import React from "react";
import "./navbar.css";

export default function Navbar() {
  return (
    <nav className="navContainer">
      <div className="left-nav">
        <a href="/home">Photo</a>
        <a href="/search/category1/empty">category1</a>
        <a href="/search/category1/empty">category2</a>
        <a href="#">category3</a>
        <a href="#">category4</a>
        <a href="#">category5</a>
      </div>
      <div className="right-nav">
        <a href="#">userinfo1</a>
        <a href="#">userinfo2</a>
        <a href="#">userinfo3</a>
      </div>
    </nav>
  );
}
